import axios from 'axios';

class UserService {
  createUser(user){
    return axios.post("http://localhost:8080/signup", user);
  }

  signin(user){
    return axios.post("http://localhost:8080/signin" ,user);
  }

  getUserDetail(username, jwt){
    const options = {
      headers: {'Authorization': 'Bearer ' + jwt}
    };
    return axios.post("http://localhost:8080/user-detail", username, options);
  }
}

export default new UserService()
